import React from "react";
import styled from "styled-components";

const Container = styled.div`
    width: 100% ;
    background-color: yellow ;
    height: 100vh ;
    display: flex ;
    justify-content:center ;
    align-items: center ;
`;
const Box = styled.div`
    background-color: black ;
    color:white;
    width: auto ;
    height: auto ;
    padding: 20px ;
    border-radius: 10px ;
`;
const Link = styled.p``;
const FramerBoc = () => {
  return (
    <Container>
      <Box> Framer Motion</Box>
      <Link>Link1</Link>
      <Link>Link2</Link>
      <Link>Link3</Link>
    </Container>
  );
};

export default FramerBoc;
